	module.exports = "var StoreView = StoreBaseView.extend({\n    init: function(){\n        this._super();\n        self = this;\n        $('.row-aside ol.ui-sortable').sortable({\n            placeholder: 'sortable-placeholder',\n            update: $.proxy(this.sortShowcase, this),\n            revert: true,\n            items: 'li'\n        });\n\n        $('.swc-title').flowtype({\n            minimum   : 80,\n            maximum   : 130,\n            minFont   : 12,\n            maxFont   : 20\n        });\n        \n        if (SHOW_RECOMMENDATIONS){\n            self.oneBoxRecommendation();\n        }\n\n        self.campaignBanner.campaignBannerInit();\n    },\n    campaignBanner: {\n        campaignBannerInit: function() {\n            this.campaignBannerGAImpression();\n\n            var campaignBanner = $('#campaign-banner a');\n            campaignBanner.click(self.campaignBanner.sendCampaignBannerGAClick);\n\n            var buttonCampaignBanner = $('.js-btn-switch-campaign-banner').filter(':visible');\n            buttonCampaignBanner.click(self.campaignBanner.campaignBannerToggle);\n\n\n        },\n        sendCampaignBannerGAClick: function(evt) {\n            evt.preventDefault();\n\n            var url = $(this).attr('href');\n            var $banner = $('#campaign-banner');\n            var tagManager = window.tagManager;\n            var dataLayer = window.dataLayer;\n\n            dataLayer.push({\n                'event': 'promotionClick',\n                'eventCategory': 'home:banner',\n                'eventAction': 'click',\n                'eventLabel': tagManager.normalize($banner.data('banner-name')),\n                'eventNonInteraction': '0',\n                'ecommerce': {\n                  'promoClick': {\n                    'promotions': [\n                      {\n                        'id': $banner.data('banner-id'),\n                        'name': tagManager.normalize($banner.data('banner-name')),\n                        'position': 1\n                      }\n                    ]\n                  }\n                },\n                eventCallback: function() {\n                    document.location = url;\n                },\n                eventTimeout: 1000\n              });\n        },\n        campaignBannerToggle:function (evt) {\n            var button = $(evt.currentTarget).off('click');\n\n            var active = $(button).data('active');\n            active = JSON.parse(active.toLowerCase());\n            if (! active) {\n                active = \"\";\n            }\n\n            $.ajax({\n                url: bannerCampaignSwitchUrl,\n                type: 'POST',\n                data: {\n                    \"active\": active,\n                    csrfmiddlewaretoken: window.CSRF_TOKEN\n                },\n                statusCode: {\n                  200: function() {\n                    if(active){\n                      //alert( \"Banner de campanha ativado em sua vitrine.\" );\n                      $('.js-campaing-banner-active').show();\n                      $('.js-campaing-banner-inactive').hide();\n                    } else {\n                      //alert( \"Banner de campanha desativado de sua vitrine.\" );\n                      $('.js-campaing-banner-active').hide();\n                      $('.js-campaing-banner-inactive').show();\n                    }\n                    self.campaignBanner.campaignBannerBindClick();\n                  }\n                }\n            });\n        },\n        campaignBannerBindClick: function () {\n            $('.banner')\n                .find('.js-btn-switch-campaign-banner')\n                .filter(':visible')\n                .click(self.campaignBanner.campaignBannerToggle);\n        },\n        campaignBannerGAImpression: function() {\n            var $banner = $('#campaign-banner');\n            var tagManager = window.tagManager;\n            var dataLayer = window.dataLayer;\n                \n            if($banner.length > 0) {\n                dataLayer.push({\n                    'event': 'promotionView',\n                    'eventCategory': 'home:banner',\n                    'eventAction': 'impression',\n                    'eventLabel': 'promotion',\n                    'eventNonInteraction': '1',\n                    'ecommerce': {\n                        'promoView': {\n                            'promotions': [\n                                {\n                                    'id': $banner.data('banner-id'),\n                                    'name': tagManager.normalize($banner.data('banner-name')),\n                                    'position': 1\n                                }\n                            ]\n                        }\n                    }\n                });\n            }        \n        }\n    },\n    saveModalShowcaseContact: function () {\n      var saveShowcaseContactURL = $(this).data('url');\n      var formData = $('.js-showcase-contact-container')\n        .find('form').serialize()\n      $.ajax({\n        url: saveShowcaseContactURL,\n        type: 'POST',\n        data: formData,\n        success: function(response) {\n          alert('Cartão de visita salvo com sucesso.');\n        },\n        error: function(){\n          alert('falha ao atualizar informações do cartão de visitas.');\n        }\n      });\n    },\n    sortShowcase: function(){\n        var order = $('.row-aside ol li').map(\n                function(){\n                    return $(this).data('order');\n                }\n            );\n\n        $.ajax({\n            type: 'POST',\n            url: '/admin/loja/ordenar_vitrines.json',\n            data: {\n                order: order.toArray().join(','),\n                csrfmiddlewaretoken: CSRF_TOKEN\n            },\n            success: function(data){\n\n            }\n        });\n    },\n\n    oneBoxRecommendation: function(){\n        if (ONEBOX_URL){\n            $.ajax({\n                url: ONEBOX_URL,\n                method: 'get',\n                data: {},\n                success: $.proxy(this.showOneBoxProducts, this)\n            });\n        }\n    },\n\n    showOneBoxProducts: function(data){\n        var onebox_div = $('.onebox-recom');\n        var onebox_list = $('<ol class=\"g-items onebox-items\" role=\"list\" />')\n\n        for (var i=0; i<data.length; i++){\n            var product = data[i];\n            var image = (product.hasOwnProperty('images') && product.images) ? product.images[0].url.replace('{w}', 160).replace('{h}', 160) : '';\n              if (product.stock_status != 3){\n\n              var template = ''+\n              '<div class=\"g-item\" data-productid=\"${id}\">' +\n                  '<a href=\"'+ SHOW_CASE_BASE_URL +'/p/${slug}/${id}/\" class=\"g-img-wrapper\" title=\"${title }\">' +\n                  '{{if images}}'+\n                      '<img src=\"'+ image +'?width=160&amp;height=160\" class=\"loaded\" alt=\"${title}\">' +\n                  '</a>' +\n                  '{{/if}}'+\n                  '<div class=\"g-desc\">'+\n                      '<a href=\"'+ SHOW_CASE_BASE_URL +'/p/${slug}/${id}/\" title=\"${title}\">' +\n                          '<h3 class=\"g-title\">${title}</h3>' +\n                            '{{if price.original > price.current}}'+\n                            '<small class=\"g-through\">de R$ '+ formatCurrency(product.price.original) +'</small>' +\n                            '{{/if}}'+\n                            '<p class=\"g-price\"><strong>por R$ '+ formatCurrency(product.price.current) +'</strong></p>' +\n                            '{{if price.instalment_months > 1}}'+\n                                '<small class=\"g-installment\">'+\n                                    '${price.instalment_months}x de R$ '+ formatCurrency(product.price.instalment_amount) +\n                                  '</small>'+\n                              '{{/if}}'+\n                      '</a>' +\n                  '</div>' +\n              '</div>';\n              onebox_list.append($.tmpl(template, product));\n            }\n        }\n\n        if (onebox_list.children().length){\n            onebox_div.show();\n            onebox_list.insertAfter(onebox_div);\n        }\n    },\n});\n"

