	module.exports = "var parseQueryString = function(queryString) {\n    var params = {}, queries, temp, i, l;\n\n    queries = queryString.split(\"&\");\n\n    for ( i = 0, l = queries.length; i < l; i++ ) {\n        temp = queries[i].split('=');\n        if (!temp[0] || !temp[1]){\n            continue;\n        }\n        params[temp[0]] = temp[1];\n    }\n\n    return params;\n};\n\n\nvar AddProductView = BaseView.extend({\n    init: function(){\n        self = this;\n        this._super();\n\n        this.MAX_PRODUCTS = window.MAX_PRODUCTS == undefined ? 30: window.MAX_PRODUCTS;\n        this.productsViewLink = $('.view-products');\n        this.modalViewProducts = $('#mod-viewproducts');\n        this.productsRows = $('.js-product-row');\n        this.productsCount = $('.js-products-count');\n        this.productsSelectCheckbox = this.productsRows.find('.pselect input[type=checkbox]');\n        this.deleteAllButton = $('button.js-delete-all');\n\n        this.bindFilters();\n        this.bindProductsActions();\n        this.updateProductsCountBar();\n\n        this.bindViewProducts();\n\n        this.bindDeleteButton();\n    },\n    bindViewProducts: function(){\n        this.productsViewLink.on('click', $.proxy(this.openModal, this));\n        this.modalViewProducts.find('#select-all').on('click', $.proxy(this.selectProducts, this));\n    },\n    bindDeleteButton: function() {\n        this.deleteAllButton.on('click', $.proxy(this.deleteAllProducts, this));\n    },\n    deleteAllProducts: function() {\n        var redirectURL = '/' + SHOWCASE_NAME + '/adicionar-produtos/banner';\n\n        $.ajax({\n            type: 'POST',\n            url: window.AJAX_URLS.deleteAllUrl,\n            data: {\n                csrfmiddlewaretoken: window.CSRF_TOKEN,\n            },\n            success: function() {\n                window.location.href = redirectURL;\n            },\n            error: function(){\n                alert('Não foi possível deletar todos os produtos');\n            }\n        })\n    },\n    openModal: function(event){\n        /*\n            open modal and load products selecteds.\n        */\n        var modalProducts = this.modalViewProducts.find('.js-modal-products');\n        var modalUrl = this.productsViewLink.data('url');\n        var modal = $(this.productsViewLink.data('target'));\n        var $self = this;\n\n        $.ajax({\n            url: modalUrl,\n            success: function(response){\n                modalProducts.empty();\n                modalProducts.append(response);\n                modal.modal('show');\n\n                $self.bindProductsActions();\n            },\n        });\n    },\n    selectProducts: function(event){\n        /* Select products on view products modal */\n        var selectAll = $(event.currentTarget);\n        var productsModalCheckbox = this.modalViewProducts.find('.js-product-checkbox');\n\n        // Mirror selectAll checked in products\n        productsModalCheckbox.prop('checked', selectAll.prop('checked'));\n        productsModalCheckbox.trigger('click');\n    },\n    bindProductsActions: function(){\n        /*\n            When click in a product checkbox should:\n\n            * Add or Remove product from store list\n            * Update progress bar and progress count\n            * Enable/Disable more checkboxes\n        */\n        this.productsRows = $('.js-product-row');\n        this.productsSelectCheckbox = this.productsRows.find('.pselect input[type=checkbox]');\n        this.productsSelectCheckbox.off('click');\n        this.productsSelectCheckbox.on('click', $.proxy(this.saveAsDraft, this));\n    },\n    saveAsDraft: function(event){\n        var productCheckbox = $(event.currentTarget);\n        var productChecked = productCheckbox.prop('checked');\n        var productRow = productCheckbox.parents('.js-product-row');\n        var productMirror = $('.js-product-row[data-id='+ productRow.data('id') +']');\n\n        var productMirrorCheckbox = productMirror.find('input[type=checkbox]');\n        var productMirrorAddedMsg = productMirror.find('.prod-add');\n        var productMirrorRemovedMsg = productMirror.find('.prod-del');\n\n        var $self = this;\n\n        $.ajax({\n            type: 'POST',\n            url: window.AJAX_URLS.saveDraftUrl,\n            data: {\n                product_id: productRow.data('id'),\n                add: productChecked,\n                csrfmiddlewaretoken: window.CSRF_TOKEN\n            },\n            success: function(response){\n                var value = parseInt($self.productsCount.data('value'));\n                if (productChecked){\n                    value++;\n                    productMirrorAddedMsg.show();\n                    productMirrorRemovedMsg.hide();\n                    productMirrorCheckbox.attr('checked', 'checked');\n                } else {\n                    value--;\n                    productMirrorAddedMsg.hide();\n                    productMirrorRemovedMsg.show();\n                    productMirrorCheckbox.removeAttr('checked');\n                }\n\n                $self.productsCount.data('value', value);\n                $self.updateProductsCountBar();\n            },\n            error: function(){\n                alert('Não foi possível salvar o produto');\n            }\n        });\n\n    },\n    updateProductsCountBar: function() {\n        // Update products count based on `qtd`\n        var products = $('.pselect input[type=checkbox]');\n        var productsChecked = products.filter(':checked');\n\n        var productsCount = this.productsCount.data('value');\n\n        this.productsViewLink.show();\n        if (!productsCount){\n            this.productsViewLink.hide();\n        } else if (productsCount >= this.MAX_PRODUCTS) {\n            this.disableAddProducts();\n            productsChecked.removeAttr('disabled');\n        } else {\n            this.enableAddProducts();\n        }\n\n        // Update progress bar\n        this.updateProductsProgressBar(productsCount);\n    },\n    updateProductsProgressBar: function(productsCount){\n        // The progress bar was fixed in css with 300px\n        // We need to calculate the percentage of products based on this width\n\n        var productsLabelCount = $('.i-add-product-status');\n        var productsProgressBar = $('.status .qtd');\n\n        productsLabelCount.text(productsCount);\n\n        var progressBarWidth = 300;\n        var progressRatio = progressBarWidth / this.MAX_PRODUCTS;\n        var progressPercentage = productsCount * progressRatio;\n\n        if (progressPercentage >= progressBarWidth){\n            progressPercentage = progressBarWidth;\n        }\n\n        productsProgressBar.css('width', progressPercentage);\n\n        // Update margin\n        var boxMarginLeft = progressPercentage - 10;\n        productsLabelCount.css('margin-left', boxMarginLeft);\n    },\n    enableAddProducts: function(){\n        var unselectedBoxes = this.productsSelectCheckbox.not(':checked');\n        unselectedBoxes.show();\n    },\n    disableAddProducts: function(){\n        var unselectedBoxes = this.productsSelectCheckbox.not(':checked');\n        unselectedBoxes.hide();\n    },\n    /* End page animations */\n\n    /* Filters */\n    bindFilters: function(event){\n        var $self = this;\n        var filters = $('[data-filter]');\n\n        filters.on('click', function(event){\n            /* Keep querystring through filters */\n            event.preventDefault();\n\n            var filterBy = $(this).data('filter');\n            var value = $(this).data('value');\n\n            $self.filterBy(filterBy, value, true);\n        });\n\n        this.bindSearchActions();\n    },\n    filterBy: function(filterBy, value, preserveFilters){\n        var new_querystring;\n\n        if (preserveFilters){\n            var current_querystring = window.location.search.substring(1);\n            new_querystring = parseQueryString(current_querystring);\n        } else {\n            new_querystring = {};\n        }\n\n        new_querystring[filterBy] = value || '';\n        new_querystring['page'] = 1;  // Reset page in every filter\n\n        document.location.search = '?' + $.param(new_querystring);\n    },\n    bindSearchActions: function () {\n        var $btnSearchAction = $('.js-products-search-action');\n        var $self = this;\n\n        $btnSearchAction.on('click', function() {\n            var inputProductTermValue = $('.js-product-search-term').val();\n            $self.filterBy('q', inputProductTermValue);\n        });\n    },\n    /* End filters */\n});\n"

